    return (
        <header className='flex w-full bg-blue-600 h-20 p-6'>
            <img src='' alt='лого'></img>
            <a className='mx-6 text-w'>Кто мы?</a>
            <a>Чем занимаемся?</a>
            <a>Наши планы</a>
